import React, { Component } from 'react'
import logo1 from './heart-rate-monitor_3703527.png';
import logo2 from './brainstorm_1786985.png';
import logo3 from './stomach_9056025.png';
import logo4 from './orthopedics_6177173.png';
import logo5 from './black-ribbon_6056687.png';
import logo6 from './embryo_819056.png';
import logo7 from './lungs_1834916.png';
import logo8 from './pediatric.png';
import logo9 from './services_5346638.png';
import logo10 from './blueprint_2704934.png';
import logo11 from './hosp.png';
import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faInstagram } from '@fortawesome/free-brands-svg-icons';
import { faCheck } from '@fortawesome/free-solid-svg-icons';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faPhoneVolume } from '@fortawesome/free-solid-svg-icons';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { faLinkedin } from '@fortawesome/free-brands-svg-icons';
import { faWhatsapp } from '@fortawesome/free-brands-svg-icons';
import { faCalendar } from '@fortawesome/free-solid-svg-icons';
import { faFileWaveform } from '@fortawesome/free-solid-svg-icons';
import { faEarthAsia } from '@fortawesome/free-solid-svg-icons';
import { faPills } from '@fortawesome/free-solid-svg-icons';
import { faHospital } from '@fortawesome/free-solid-svg-icons';

export default class Appointment extends Component {
  render() {
    return (
      <div>
        <div className="appt">
        <h1>Book  <span>Your Appointments </span> Now</h1><br></br>
        <div className="mncont">
        <div className="mncont1">
        <div className='icon'><FontAwesomeIcon icon={faCalendar} /></div>
          <h1>Book Your Appointment</h1>
          <a href="#">Learn More--></a>
        </div>
        <div className="mncont1">
        <div className='icon'><FontAwesomeIcon icon={faFileWaveform} /></div>
          <h1>Book Health Checkup</h1>
          <a href="#">Learn More--></a>
        </div>
        <div className="mncont1">
        <div className='icon'><FontAwesomeIcon icon={faEarthAsia} /></div>
          <h1>Consult Online</h1>
          <a href="#">Learn More--></a>
        </div>
        <div className="mncont1">
        <div className='icon'><FontAwesomeIcon icon={faPills} /></div>
          <h1>Online Medicine </h1>
          <a href="#">Learn More--></a>
        </div>
        <div className="mncont1">
        <div className='icon'><FontAwesomeIcon icon={faHospital} /></div>
          <h1>Our Hospitals </h1>
          <a href="#">Learn More--></a>
        </div>
      </div>
        </div>
      </div>
    )
  }
}
